INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17850,1,451,'let-858 3''UTR',16270,'let-858 encodes nucampholin, a highly conserved protein rich in acidic and basic residues that also shares some similarity to eukaryotic initiation factor eIF-4 gamma; LET-858 is required for early embryogenesis and tissue differentiation and is expressed ubiquitously throughout development; LET-858 localizes to nuclei where it overlaps, but is not restricted to, chromosomal regions; based upon its sequence and localization, LET-858 is likely to be involved in protein synthesis and/or RNA binding. ','');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17851,1,451,'unc-54 3''UTR',16270,'3''UTR for unc-54, which encodes a muscle myosin class II heavy chain (MHC B); UNC-54 is the major myosin heavy chain expressed in C. elegans and is required for locomotion and egg-laying; in vivo and in vitro, UNC-54 interacts with ITR-1, an IP3 receptor, and this interaction may provide a link between calcium signaling and the muscle cytoskeleton; UNC-54 is a thick filament component that is expressed in multiple muscle cell classes including body wall, intestinal, anal depressor, and sphincter muscles as well as sex-specific muscles that develop postembryonically.','');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17852,1,105,'aex-5 exon1',16270,'exon for aex-5, an ortholog of calcium-dependent serine endoproteinases, the kex2/subtilisin-like proprotein convertase that affects defecation cycle and anterior body contractions; and is expressed in all muscle cells except pharyngeal muscles.','ATGAAATTAATTTTCCTGCTTTTGCTTTTTGGGGGTTTCCCCTATTGTTTGTCAAGAGTTTCGAGGACGGCGTTTTTCTTGCTAAAATCACAAGTATTGATGAGCACGATGCAAGAAAGATCGGAAGAAGGTTTGGGTTTGAGGCTCAGTGGAAG');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17853,1,451,'glh-2 3''UTR',16270,'3''UTR of glh-2, which encodes a putative DEAD-box RNA helicase that contains six CCHC zinc fingers and is homologous to Drosophila VASA, a germ-line-specific, ATP-dependent, RNA helicase; at non-permissive temperatures, GLH-2 plays a role in germ-line development and fertility, specifically in regulating the normal extent of germ-line proliferation, oogenesis, and the production of functional sperm; GLH-2 activity may also be required for the wild-type morphology of P granules and for localization of several protein components, but not accumulation of P granule mRNA components; GLH-2 interacts in vitro with itself and with KGB-1, a JNK-like MAP kinase; GLH-2 is a constitutive P granule component and thus, with the exception of mature sperm, is expressed in germ cells at all stages of development; GLH-2 is cytoplasmic in oocytes and the early embryo, while perinuclear in all later developmental stages as well as in the distal and medial regions of the hermaphrodite gonad; GLH-2 is expressed at barely detectable levels in males.','');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17854,1,247,'Cbr-unc-119',16269,'C. briggsae unc-119, which encodes a novel protein that is highly conserved amongst metazoans; unc-119 activity is required for proper development of the nervous system, including axonal branching and fasciculation, and hence, for normal movement, chemosensation, and feeding; unc-119 is expressed pan-neuronally beginning in the early embryo (~60 cells) and continuing through adulthood; although the molecular function of UNC-119 is not yet known, human UNC119, which can rescue C. elegans unc-119 mutant animals, is reported to function as a receptor-associated activator of signal transduction; thus, UNC-119 may be part of a signal transduction pathway that mediates axonal patterning in response to external developmental cues.','');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17855,1,122,'mec-7 promoter',16270,'promoter for mec-7, which encodes a beta-tubulin required for touch sensitivity along the body wall, and for normal levels of locomotor activity; it is strongly expressed in six touch receptor neurons, with weak expression in FLP, PVD, and BDU cells.','');
INSERT INTO Feature(id,source,type_id,name,organism_id,description,sequence)VALUES (17856,1,122,'glh-2 promoter',16270,'promoter for glh-2, which encodes a putative DEAD-box RNA helicase that contains six CCHC zinc fingers and is homologous to Drosophila VASA, a germ-line-specific, ATP-dependent, RNA helicase; at non-permissive temperatures, GLH-2 plays a role in germ-line development and fertility, specifically in regulating the normal extent of germ-line proliferation, oogenesis, and the production of functional sperm; GLH-2 activity may also be required for the wild-type morphology of P granules and for localization of several protein components, but not accumulation of P granule mRNA components; GLH-2 interacts in vitro with itself and with KGB-1, a JNK-like MAP kinase; GLH-2 is a constitutive P granule component and thus, with the exception of mature sperm, is expressed in germ cells at all stages of development; GLH-2 is cytoplasmic in oocytes and the early embryo, while perinuclear in all later developmental stages as well as in the distal and medial regions of the hermaphrodite gonad','');
